import React from "react"
import "./Homepage.css"
const Homepage = ({setLoginUser}) => {
    return (
        <div className="homepage">
            <h1>
                THANK YOU FOR REGISTERING
            </h1>
            <div className="button" onClick={() => setLoginUser({})} >Logout</div>
        </div>
    )
}
export default Homepage
